import React, { Component } from 'react'

class FooterWall extends Component {
    render() {
        return (
            <footer className="footer">
                <span className="text-muted">All Rights Reserved 2019 @RMIT SEPT-team-High5</span>
            </footer>
        )
    }
}

export default FooterWall
